  \"2015-02-04T18:49:58.544983\",\n\t\"name\": \"dot-towing-41dc7\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Cars that are towed within city limits are
  taken to either the Main Impound Storage Facility located at 6700 Pulaski Highway,
  or a smaller holding facility at 410 Fallsway. The majority of abandoned vehicles,
  scofflaw vehicles and cars that are towed as a result of an accident or police activity
  are taken to the Main Impound Storage Facility. Vehicles that are illegally parked
  along major city gateways during peak hours (rush hour) are placed at the Fallsway
  lot for up to 48 hours. If the vehicle is not retrieved from the facility within
  48 hours, it is then moved to the Pulaski Highway lot where storage fees may be
  assessed. Vehicles remaining at the Fallsway facility by the close of business each
  Friday will also be moved to Pulaski Highway.\",\n\t\"license_title\": \"Other License
